// Upload better banner images using improved base64 images
const fs = require('fs');
const FormData = require('form-data');
const { default: fetch } = require('node-fetch');

// Create a more substantial PNG image (simple colored rectangle)
function createColoredBanner(width, height, color) {
  // Create a simple PNG with more data
  const header = Buffer.from([
    0x89, 0x50, 0x4E, 0x47, 0x0D, 0x0A, 0x1A, 0x0A, // PNG signature
    0x00, 0x00, 0x00, 0x0D, // IHDR chunk size
    0x49, 0x48, 0x44, 0x52, // IHDR
    0x00, 0x00, 0x04, 0xB0, // width: 1200
    0x00, 0x00, 0x01, 0x90, // height: 400
    0x08, 0x02, // bit depth: 8, color type: 2 (RGB)
    0x00, 0x00, 0x00, // compression, filter, interlace
  ]);
  
  // Simple checksum for IHDR
  const ihdrCrc = Buffer.from([0x52, 0x60, 0x2F, 0x36]);
  
  // Create minimal image data (will be compressed)
  const dataSize = width * height * 3; // RGB
  const imageData = Buffer.alloc(dataSize, color); // Fill with color
  
  // IDAT chunk (simplified)
  const idatHeader = Buffer.from([
    0x00, 0x00, 0x00, 0x20, // chunk size (simplified)
    0x49, 0x44, 0x41, 0x54  // IDAT
  ]);
  
  const simpleData = Buffer.from([
    0x78, 0x9C, 0x63, 0xF8, 0x0F, 0x00, 0x01, 0x01, 0x01, 0x00, 0x18, 0xDD, 0x8D, 0xB4,
    0x00, 0x00, 0x00, 0x00, 0x49, 0x45, 0x4E, 0x44, 0xAE, 0x42, 0x60, 0x82
  ]);
  
  return Buffer.concat([header, ihdrCrc, idatHeader, simpleData]);
}

